"    <div id=\"topicTitle\">",
"     Patient information: Prosthetic valves (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/prosthetic-valves-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H1669114789\">",
"      <span class=\"h1\">",
"       What is a prosthetic valve?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A prosthetic valve is a valve that a doctor puts in the heart to replace a damaged heart valve (",
"      <a class=\"graphic graphic_figure graphicRef58389 \" href=\"UTD.htm?35/42/36516\">",
"       figure 1",
"      </a>",
"      ). Prosthetic valves are used to treat different heart conditions, usually when they get severe. These conditions include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Stenosis &ndash; This is when a valve doesn&rsquo;t open fully. Examples include aortic stenosis (",
"        <a class=\"graphic graphic_figure graphicRef74714 \" href=\"UTD.htm?14/7/14452\">",
"         figure 2",
"        </a>",
"        ) and mitral stenosis.",
"       </li>",
"       <li>",
"        Regurgitation &ndash; This is when a valve leaks, and blood flows in the wrong direction. Examples include aortic regurgitation and mitral regurgitation.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      There are 2 main types of prosthetic heart valves:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Mechanical &ndash; These valves are made from man-made materials. They can last 20 to 30 years or longer.",
"       </li>",
"       <li>",
"        Biological &ndash; These are made from valve tissue from a pig, cow, or horse. In some cases, they come from another person. These valves usually last 10 to 15 years.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Although prosthetic valves help treat heart conditions, they can cause problems of their own.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1669114847\">",
"      <span class=\"h1\">",
"       What problems can happen with prosthetic valves?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The problems that can happen depend mostly on the type of valve and where it is in the heart. In general, mechanical valves cause more problems than biological valves.",
"     </p>",
"     <p>",
"      Problems that can happen with prosthetic valves include the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood clots can form on the valve. This is a problem because clots can break off and travel through the blood vessels to other parts of the body. They can then get stuck in and block off small blood vessels. This can cause organ damage and symptoms. Sometimes, a blood clot can also block the valve.",
"       </li>",
"       <li>",
"        People can have side effects from their treatment. Some people need to take a type of medicine called &ldquo;anticoagulation&rdquo; medicine every day to help keep blood clots from forming. Anticoagulation medicines can make people bleed much more easily than normal.",
"       </li>",
"       <li>",
"        The valve can get infected, which doctors call &ldquo;endocarditis.&rdquo; With endocarditis, small growths can form on the prosthetic valve. These growths can break off, travel to, and block small blood vessels in other parts of the body.",
"       </li>",
"       <li>",
"        The valve can leak or get blocked by scar tissue.",
"       </li>",
"       <li>",
"        The valve can damage red blood cells as blood flows through the heart. This can cause a condition called &ldquo;anemia.&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1669114862\">",
"      <span class=\"h1\">",
"       How do I manage my prosthetic valve?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Long-term management for a prosthetic valve depends on the type of valve, where it is in the heart, and your individual situation.",
"     </p>",
"     <p>",
"      All people who have a prosthetic valve need to take some kind of medicine to help keep blood clots from forming. People who have a mechanical valve usually take an anticoagulation medicine called",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?33/2/33830?source=see_link\">",
"       warfarin",
"      </a>",
"      (sample brand name: Coumadin&reg;). Some people with a biological valve might also need to take this. But most people with a biological valve instead take",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"       aspirin",
"      </a>",
"      every day.",
"     </p>",
"     <p>",
"      If you take",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?33/2/33830?source=see_link\">",
"       warfarin",
"      </a>",
"      , you need to take it exactly as instructed. If you forget or miss a dose, call your doctor to find out what to do. People who take warfarin also need regular blood tests. That&rsquo;s because the medicine&rsquo;s effects can change over time. At the wrong doses, the medicine can either stop working or lead to serious bleeding.",
"     </p>",
"     <p>",
"      Other parts of long-term management usually include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Follow-up visits and tests to check your prosthetic valve &ndash; Your doctor will talk with you and do an exam. Sometimes, he or she will order an echocardiogram (also called an &ldquo;echo&rdquo;). An echo uses sound waves to create a picture of your heart as it beats. It shows the size of the heart chambers, how well the heart is pumping, and how well the heart valves are working (",
"        <a class=\"graphic graphic_figure graphicRef77971 \" href=\"UTD.htm?33/35/34354\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Taking antibiotic medicines before going to the dentist or having certain dental or medical procedures &ndash; This can help prevent endocarditis.",
"       </li>",
"       <li>",
"        Avoiding certain activities or sports &ndash; If you take anticoagulation medicine, your doctor will probably recommend that you avoid sports and activities in which you could easily get hurt or bleed.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1669114900\">",
"      <span class=\"h1\">",
"       What if I have a prosthetic valve and want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you have a prosthetic valve and want to get pregnant, talk with your doctor. Women who take anticoagulation medicine might need to change their medicine during pregnancy. There are different anticoagulation medicines. Some have a higher chance of harming an unborn baby than others.",
"     </p>",
"     <p>",
"      You, your heart doctor, and your pregnancy doctor will work together to decide which anticoagulation medicine is right for you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H1669114915\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?18/60/19394?source=see_link\">",
"       Patient information: Mitral regurgitation (The Basics)",
"      </a>",
"      <br/>",
