"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?21/4/21571?source=see_link\">",
"       Patient information: Mitral valve prolapse (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?12/31/12787?source=see_link\">",
"       Patient information: Mitral stenosis in adults (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?31/35/32306?source=see_link\">",
"       Patient information: Aortic regurgitation in adults (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?26/59/27575?source=see_link\">",
"       Patient information: Mitral regurgitation (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?37/37/38484?source=see_link\">",
"       Patient information: Stroke symptoms and diagnosis (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?21/15/21747?source=see_link\">",
"       Patient information: Warfarin (Coumadin) (Beyond the Basics)",
"      </a>",
"     </p>",
