"   <div class=\"block mop drugH1Div\" id=\"F137908\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Heart rate, blood pressure, pulse, mental status; intravenous administration requires a cardiac monitor",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     <i>",
"      Organophosphate or carbamate insecticide or nerve agent poisoning:",
"     </i>",
"     Heart rate, blood pressure, respiratory status, oxygenation secretions. Maintain atropinization with repeated dosing as indicated by clinical status. Crackles in lung bases, or continuation of cholinergic signs, may be signs of inadequate dosing. Pulmonary improvement may not parallel other signs of atropinization. Monitor for signs and symptoms of atropine toxicity (eg, fever, muscle fasciculations, delirium); if toxicity occurs, discontinue atropine and monitor closely.",
"    </p>",
"   </div>",
