"   <div class=\"block pha drugH1Div\" id=\"F137898\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Blocks the action of acetylcholine at parasympathetic sites in smooth muscle, secretory glands, and the CNS; increases cardiac output, dries secretions. Atropine reverses the muscarinic effects of cholinergic poisoning due to agents with acetylcholinesterase inhibitor activity by acting as a competitive antagonist of acetylcholine at muscarinic receptors. The primary goal in cholinergic poisonings is reversal of bronchorrhea and bronchoconstriction. Atropine has no effect on the nicotinic receptors responsible for muscle weakness, fasciculations, and paralysis.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F137917\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: I.M., I.V.: Rapid",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: I.M.: Rapid and well absorbed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: Widely throughout the body; crosses blood-brain barrier",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via enzymatic hydrolysis",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 2-3 hours; Children &lt;2 years of age: 7 hours; Elderly 65-75 years of age: 10 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: I.M.: 3 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (30% to 50% as unchanged drug and metabolites)",
"    </p>",
"   </div>",
