var title_f11_23_11644="Treatment Turner I";
var content_f11_23_11644=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F50455&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F50455&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of Turner syndrome: Gonadal dysgenesis, growth failure, skeletal dysgenesis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Characteristic",
"       </td>",
"       <td class=\"subtitle1\">",
"        Neonatal period or at diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Childhood",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adolescence",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gonadal dysgenesis",
"       </td>",
"       <td>",
"        <p>",
"         Look for mosaicism.",
"        </p>",
"        <p>",
"         Look for Y-chromosome material if marker chromosome or virilization is present.",
"        </p>",
"       </td>",
"       <td>",
"        Discuss reproductive options when appropriate.",
"       </td>",
"       <td>",
"        <p>",
"         Check follicle-stimulating hormone and luteinizing hormone before initiating hormone-replacement therapy around 12 years of age.",
"        </p>",
"        <p>",
"         Begin therapy with low doses of estradiol, and gradually increase during the next two to four years.",
"        </p>",
"       </td>",
"       <td>",
"        Continue hormone replacement.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Growth failure",
"       </td>",
"       <td>",
"        Plot growth on growth curve specific for those with Turner syndrome.",
"       </td>",
"       <td>",
"        <p>",
"         Continue to monitor growth.",
"        </p>",
"        <p>",
"         Check thyroxine and thyrotropin levels. Check for obesity.",
"        </p>",
"        <p>",
"         Institute dietary counseling.",
"        </p>",
"        <p>",
"         Start growth horomone therapy with or without anabolic steroid when growth velocity declines.",
"        </p>",
"       </td>",
"       <td>",
"        Stop growth hormone when bone age exceeds 15 years or growth velocity drops below 2 cm/year.",
"       </td>",
"       <td>",
"        <p>",
"         Check thyroxine and thyrotropin levels.",
"        </p>",
"        <p>",
"         Check thyroid antibodies every&nbsp;three to&nbsp;five years.",
"        </p>",
"        <p>",
"         Continue dietary counseling.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Skeletal dysgenesis",
"       </td>",
"       <td>",
"        Check for dislocated hips.",
"       </td>",
"       <td>",
"        <p>",
"         Watch for scoliosis.",
"        </p>",
"        <p>",
"         Watch knee for tibial problems.",
"        </p>",
"       </td>",
"       <td>",
"        Watch for scoliosis, lordosis, and kyphosis.",
"       </td>",
"       <td>",
"        <p>",
"         Ensure adequate calcium intake (1.2 g/day).",
"        </p>",
"        <p>",
"         Encourage weight-bearing exercise.",
"        </p>",
"        <p>",
"         Check bone mineral density every&nbsp;three to&nbsp;five years.",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
