"       Congenital disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Congenital GnRH deficiency (Kallmann syndrome)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Hemochromatosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Multiorgan genetic disorders (Prader-Willi syndrome, Laurence-Moon-Beidl syndrome, familial cerebellar ataxia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Acquired disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Pituitary and hypothalamic tumors (macroadenoma, craniopharyngioma)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Infiltrative disorders (sarcoidosis, histiocytosis, tuberculosis, fungal infections)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Trauma, postsurgery, postirradiation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Vascular (infarction, aneurysm)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Hormonal (hyperprolactinemia, androgen excess, estrogen excess, cortisol excess)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Drugs (opioids and psychotropic drugs, GnRH agonists or antagonists)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Systemic disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Chronic illnesses",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Nutritional deficiencies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Obesity",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Primary gonadal disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_single\">",
"       Congenital disorders",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Klinefelter's syndrome (XXY) and its variants (XXY/XY; XXXY)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Cryptorchidism",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Myotonic dystrophy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Functional prepubertal castrate syndrome (congenital anorchia)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Varicocele",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Androgen insensitivity syndromes",
"      </td>",
"     </tr>",
"     <tr>",
